CREATE DATABASE tavlingDB; USE tavlingDB; FLUSH PRIVILEGES;

CREATE TABLE Sport(
sportID INTEGER,
name CHAR(20),
PRIMARY KEY (sportID));


CREATE TABLE location(
country CHAR(40),
province_state CHAR(40),
city CHAR(40),
PRIMARY KEY (country, province_state, city)
);


CREATE TABLE Team(
teamID INTEGER,
name CHAR(20),
country CHAR(40) NOT NULL,
province_state CHAR(40) NOT NULL,
city CHAR(40) NOT NULL,
PRIMARY KEY (teamID),
FOREIGN KEY (country, province_state, city) REFERENCES Location(country, province_state, city)
ON DELETE NO ACTION
ON UPDATE CASCADE
);


CREATE TABLE Person(
personID INTEGER,
name CHAR(40),
gender CHAR(1),
birthDate DATE,
isCompetitionManager BOOLEAN,
PRIMARY KEY (personID)
);


CREATE TABLE Athlete(
weight INTEGER,
height INTEGER,
athleteID INTEGER,
teamID INTEGER,
country CHAR(20),
PRIMARY KEY (athleteID),
FOREIGN KEY (athleteID) REFERENCES Person(personID)
ON DELETE CASCADE,
FOREIGN KEY (teamID) REFERENCES Team(teamID)
ON DELETE SET NULL
);



CREATE TABLE Coach(
coachID INTEGER,
experienceLevel CHAR(40),
country CHAR(40) NOT NULL,
province_state CHAR(40) NOT NULL,
city CHAR(40) NOT NULL,
PRIMARY KEY (coachID),
FOREIGN KEY (coachID) references person(personID)
ON DELETE CASCADE,
FOREIGN KEY (country, province_state, city) REFERENCES Location(country, province_state, city)
ON DELETE NO ACTION
ON UPDATE CASCADE
);


CREATE TABLE SBSport(
sportID INTEGER,
/*WR FLOAT,*/
unit CHAR(6),
PRIMARY KEY (sportID),
FOREIGN KEY (sportID) REFERENCES Sport(sportID));

CREATE TABLE TBSport(
sportID INTEGER,
/*WR TIME,*/
PRIMARY KEY (sportID),
FOREIGN KEY (sportID) REFERENCES Sport(sportID));

CREATE TABLE Division(
divisionID INTEGER,
maxAge INTEGER,
minAge INTEGER,
gender CHAR(1),
PRIMARY KEY (divisionID));

